import React from "react";

import Button from '@material-ui/core/Button';
import { Link } from "react-router-dom";

const StartPage = () => {

    return (
        <div>
            <h2>Start Page</h2>
            <Link to="/login">
                <Button
                    className={classes.createButton}
                    variant="contained"
                    color="primary"
                >Login</Button>
            </Link>
        </div>
    );
}
export default StartPage;
